    "2013-03-15T23:29:24.041717",nt"name": "the-geology-of-the-milton-quadrangle-vermont",nt"isopen":
    false,nt"url": null,nt"notes": "This resource is available as a downloadable
    file, ESRI Service, and as a Web Feature service. Resource includes a Bedrock map
    and text on Bedrock geology for a Portion of the Milton Quadrangle, Vermont. For
    more information see links provided. Abstract:The Milton quadrangle borders Lake
    Champlain north of Burlington, nVermont. The bedrock, from west to east, includes
    a narrow strip of Ordovician foreland rocks which is overridden by a miogeosynclinal
    Cambrian and Ordovician sequence along the Champlain thrust; this sequence underlies
    the main central part of the quadrangle. East of the Hineshurg thrust there is transition
    into the eugeosyncline of lowest Cambrian or earlier age. The Hineshurg synelinorium
    and the Georgia Mountain anticlinorium are the principal structural features between
    the two major thrusts. Three klippen are erosional outliers of the Brigham nHill
    thrust sheet.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
